import React from "react";
import "../navBar.css";
import List from "@material-ui/core/List";
import { Link } from "@material-ui/core/Link/Link";
const NavBarBtns = (props) => {
  return (
    <List className="navBarList">
      <Link className="navBarBtn" h>
        <button className="Btn" >تبت نام / ورود</button>
      </Link>
      <Link className="navBarBtn" href="/package">
        <button className="Btn2" >خرید اشترک</button>
      </Link>
    </List>
  );
};
export default NavBarBtns;
